public E next() {
  if (hasNext()) {
    lastEntry = node.entries[index];
    lastIndex = index;
    lastNode = node;
    if (++index > node.rightIndex) {
      node = node.next;
      if (node != null) {
        index = node.leftIndex;
      }
    }
    return lastEntry;
  } else {
    throw new NoSuchElementException("Iterator exhausted");
  }
}
